(1, '#Fightagainstcorona', 'Ridiculus sociosqu cursus neque ______ curae ante scelerisque vehicula.', '2020-05-22', 'https://g.page/binplustech?share', 'hfhfgh', '                                                                                                                            ghvsfbvvghkklaoyoajopluiuuuui                            ', 'jhansi', 'Admin', '1590165166ngo.jpg', NULL, 0, '2020-05-27 07:02:25', 'Warhapur', 'Uttar Pradesh', NULL, '123456', 'qwert12345', 'qwert'),
(2, 'Sightsavers', 'Ridiculus sociosqu cursus neque ______ curae ante scelerisque vehicula.', '2020-04-24', 'https://g.page/binplustech?share', 'Sightsavers\' work in India has enabled thousands of people to lead lives of independence and dignity. We have been working with local partners to strengthen organisations and communities, and have supported the treatment of millions of people with eye disorders. We have educated, counseled, trained and rehabilitated people who are visually impaired or blind, and helped extend the reach of eye services to the least served areas of India.', '<p><span style=\"font-family: Lato, sans-serif; font-size: 18px; background-color: rgb(231, 235, 244);\">Blindness is an important cause and the effect of poverty. We work with poor and marginalised communities in developing countries. At Sightsavers, we believe that people should not go blind unnecessarily. We prevent, treat and cure avoidable blindness and promote eye health.</span></p><p><span style=\"font-family: Lato, sans-serif; font-size: 18px; background-color: rgb(231, 235, 244);\">People with visual impairment should be able to develop their potential to the full. We work with disabled people and others to promote equal rights and opportunities. We strengthen organisations and commnities to develop practical and enduring solutions.</span></p><p><span style=\"font-family: Lato, sans-serif; font-size: 18px; background-color: rgb(231, 235, 244);\">We achieve much more when we collaborate. We forge alliances and partnerships to ensure a positive and long term impact on people\'s lives. Our supporters are a key part of the solution. We work together to accomplish our goals.</span><span style=\"font-family: Lato, sans-serif; font-size: 18px; background-color: rgb(231, 235, 244);\"><br></span><span style=\"font-family: Lato, sans-serif; font-size: 18px; background-color: rgb(231, 235, 244);\"><br></span></p>', 'ftggvrtg', 'Admin', '1590165428ngo3.jpg', NULL, 0, '2020-05-22 16:37:08', NULL, NULL, NULL, '', '', ''),
(3, 'etgege', 'hello ', '2020-04-24', 'https://g.page/binplustech?share', 'hfhfgh', '                                                                                             jnnhjnfdgdfgdfg                            ', 'agra', 'Admin', '1590169610ngo12.jpg', NULL, 0, '2020-05-26 15:51:13', NULL, NULL, 'yes', '', '', ''),
